CREATE SCHEMA IF NOT EXISTS crypto_bdd;
USE crypto_bdd;

CREATE TABLE  IF NOT EXISTS ada_usd (
    date DATE,
    open DECIMAL(15, 10),
    high DECIMAL(15, 10),
    low DECIMAL(15, 10),
    close DECIMAL(15, 10),
	adj_close DECIMAL(15, 10),
    volume BIGINT(16),
    PRIMARY KEY(date)
);


